import React from 'react'
import data from '../businesses.json'

export default function BusinessMap() {

    const map = data.map((business) => {
        return (<li className="list"> {business.name} </li>)
    })

    return (
        <ul className ="businesses list">
            {map}
        </ul>
    )
}
